import React,{Component} from 'react';
import picture from '../img/profile_pic.jpeg';
class About extends Component{
    render(){

        return(
            <div>
                <h1>My name is Natali</h1>
                <img src={picture} width="300" height="200"/>
            </div>
        );
    }
}

export default About;
